const getCatalogItemName =
  catalog =>
  (itemCode = '') => {
    const { name = '' } = catalog.find(i => i.code.toString() === itemCode.toString()) || {}
    return name
  }

const getCatalogItemCode =
  catalog =>
  (itemName = '') => {
    const { code = '' } = catalog.find(i => i.name.toString() === itemName.toString()) || {}
    return code
  }

const catalogToLabelValue = (catalog, sorted = false) => {
  const toLabelValue = ({ code, name, ...extraProps }) => ({ value: code, label: name, ...extraProps })
  return pipe(
    map(toLabelValue),
    when(() => sorted, sortBy(prop('label')))
  )(catalog)
}

